import React from 'react';
import Table from 'react-bootstrap/Table';
import "bootstrap/dist/css/bootstrap.css";

function Prices () {
    return (
        <Table striped bordered hover variant="grey" id="prices-table">
            <thead>
                <tr>
                    <th>$</th>
                    <th>Item</th>
                    <th>Quantity</th>
                </tr>
                <tr>
                    <td>1</td>
                    <td>Paper Thin Sticker</td>
                    <td>$3.00</td>
                </tr>
            </thead>
        </Table>
    );
}

export default Prices;
